import itertools

MINN = 2
MAXN = 32
LEVEL = 21
MAXJ = 500


def converter(number, base):
    if base == 10: return int(number)
    figures = [int(i) for i in str(number)]
    figures = figures[::-1]
    result = 0
    for i in range(len(figures)):
        result += figures[i] * base ** i
        # print(figures[i])
    return result


def find_prime_factor(x):
    if x < 65536:
        if x in p:
            return None
    for prime in p:
        if x % prime == 0:
            return prime
    return None


def offline_find_factors(s):
    result = list()
    if converter(s, 2) in p:
        return None
    else:
        for base in range(2, 11):
            factor = find_prime_factor(converter(s, base))
            # if s=="100011": print({converter(s, base): factor})
            if factor:
                result.append(factor)
            else:
                return None
    return result


def online_find_coins(minn=MINN, maxn=MAXN, maxj=MAXJ):
    results = list()
    for n in range(minn, maxn + 1):
        result = list()
        j = 0
        for x in itertools.product('01', repeat=n - 2):
            s = "1" + ("".join(x)) + "1"
            possible_factors = offline_find_factors(s)
            if possible_factors:
                result.append(s + " " + " ".join(str(x) for x in possible_factors))
                j += 1
            if j >= maxj: break
        results.append(result)
    return results


